(2, 'Изменения', '<img src="assets://pawAnim1" /><img src="assets://pawAnim2" /><img src="assets://pawAnim3" /><img src="assets://pawAnim1" /><img src="assets://pawAnim2" /><img src="assets://pawAnim3" /><br /><span style="color:#FFFFFF;">О важных изменениях</span>*em1*<br /><span style="color:#FFCC00;">Забеги и мир</span><br /><span style="color:#C9E79F;">Теперь "действия" это иконка <img src="assets://a105" /> или <img src="assets://a106" /><br /> находится на верхней панели в левом углу (всё управление там)<br />а стать зрителем называется теперь Стать НЛО*em4*<br />Управление в мире теперь работает на виджете<br />(это окно можно переносить в любое место)</span>\r\n<br />\r\n<span style="color:#FFCC00;">Иконки статуса КоронаАдмин будут убраны после полного перехода<br />на эту версию игры</span><br /><span style="color:#C9E79F;">вместо него теперь можно ставить в ник смайлики, просто выбираете смайлик из чата и вставляете его код прямо в ник)\r\nДопускается 2 смайлика максимум.</span>\r\n<br />\r\n<span style="color:#FFCC00;">Про смайлики</span><br /><span style="color:#C9E79F;">Старый набор смайликов был убран, так-как тот набор не подходит.<br />Добавлены смайлики*em101**em102**em103**em104**em105**em106**em107**em108**em109**em110*</span>\r\n<br />\r\n<span style="color:#FFCC00;">Исчезающие типы уведомлений</span><br /><span style="color:#C9E79F;">примеры <span style="color:#FD92FE" onclick="notifyOK(тестовое уведомление)">успех</span> <span style="color:#FD92FE" onclick="notifyInfo(тестовое уведомление)">информация</span> <span style="color:#FD92FE" onclick="notifyWarn(тестовое уведомление)">внимание</span> <span style="color:#FD92FE" onclick="notifyErr(тестовое уведомление)">ошибка</span></span>\r\n<br />\r\n<span style="color:#FFCC00;">Виджеты</span><br /><br /><span style="color:#C9E79F;">Виджеты это окна, но виджеты не перекрывают сцену игры.<br />И виджеты можно перетаскивать потянув за верхнюю часть.<br /><img src="assets://w2" /><br />Виджеты используются в редакторе карт, в альбоме, в мире.</span>\r\n<br />\r\n<img src="assets://pawAnim1" /><img src="assets://pawAnim2" /><img src="assets://pawAnim3" /><img src="assets://pawAnim1" /><img src="assets://pawAnim2" /><img src="assets://pawAnim3" />', 0, 0),
(4, 'Без имени', '<span style="color:#FFCC00;">Побег собачек</span><br /><img src="assets://ava100" /><br /> <img src="assets://shop" onclick="clickIT(shop)" /> <img src="assets://bag1" onclick="clickIT(bag)" /> <img src="assets://top" onclick="clickIT(top)" /> <img src="assets://ny1" onclick="clickIT(nytop)" /><br /><span style="color:#FFCC00;" onclick="clickIT(userInfo,1)"><img src="assets://adminIcon" /> Тык на админушку*em3*</span>', 1641981956, 1);

