  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=5 ;

--
-- Дамп данных таблицы `popuptext`
--

INSERT INTO `popuptext` (`id`, `t`, `type`, `name`, `text`, `access`) VALUES
(1, 1, 'chatRules', 'Правила чата', 'Правила общения\r\nЗАПРЕЩАЕТСЯ:\r\n1. Использование нецензурной лексики в любой форме.\r\n2. Прямые или косвенные оскорбления игроков, администрации и игры непосредственно.\r\n3. Распространение ссылок на подозрительные ресурсы.\r\n4. Флуд (злоупотребление смайликами и знаками, повторение одного сообщения, повторение смайликов более 3 раз в столбик. Бессмысленные сообщения.\r\n5. Тематика (смерть, фашизм, расизм, 18+)\r\n6. Частое попрошайничество подарков - предупреждение, потом удаление, далее минута бана, далее 5 минут бана.\r\n7. Агитация или создание конфликта - предупреждение, удаление, бан 15 минут.\r\n\r\nНезначительные нарушения - бан от 1 минуты. При повторных нарушениях время бана увеличивается.\r\nГрубые нарушения - бан на усмотрение модератора.\r\nМодератор может удалять и выдавать бан за сомнительные сообщения.\r\n\r\nНик не должен содержать оскорбления, тематику, флуд (к примеру ники вида 111111111, яяяяяяяяяяяя подлежат смене) Нельзя ставить ник без разрешения который относится к администрации (к примеру админ, модератор, модератор карт, кабанчик, система) если вы ставите подобные ники, будьте готовы к тому что ваш ник будет изменён на стандартный. Если вы продолжаете ставить ник администрации - смена ника может быть отключена.\r\n----------------------------------------\r\nОбщие правила\r\n1. Запрещается использование читерских программ для изменения логики игры (накрутка, скорость в забегах и тд) Нарушение этого правила может привести к ограничению доступа к забегам, или к полной блокировке страницы (разблокировка платная)\r\n2. Аватарка игрока (фотография) не должна содержать оскорбления, тематику 18+ ... Нарушение этого правила приведёт к ограничению доступа к аватарке.', 0),
(2, 1, 'ownerAccountRules', 'Правила создания страницы', 'Правила создания страницы\r\n\r\nТермины и определения\r\nХозяин - Вы, владелец страницы, всегда имеет полные права доступа.\r\nПрава доступа - Возможности которые будут предоставлены странице\r\n-------------------------------------------\r\nВы хозяин, создаёте страницу которую можете отдать поиграть абсолютно безопасно, при этом хозяин может управлять страницей в любое время, и только хозяин решает какие права доступа предоставить. Страница будет иметь тот же ID который у хозяина, абсолютно всё тоже самое, разница в том что не нужно давать логин и пароль, всякие ключи авторизации, хозяин просто получает ссылку которую и отправляет тому игроку, кому и даёт поиграть. А страница хозяина всегда в безопасности!\r\nНекоторые действия можно выполнить только от хозяина страницы, к примеру сменить ник.\r\nХозяин тоже может зайти на страницу (например перед тем как сообщит ссылку, может захочет проверить правильно ли выдал права доступа) или просто захочет к примеру смотреть чат на двух страницах сразу, это тоже возможно.\r\n\r\nКак выбрать права доступа?\r\nПосле создания страницы даются права к забегам, хозяин в любой момент может изменить права доступа.\r\nЕсли хозяин отдаёт страницу только для забегов, зачем выдавать права к примеру (отправка подарков, обмен валюты) так и валюта в безопасности.\r\nТакая передача страницы не считается нарушением правил и не считается взломом, а наоборот приносит удовольствие, к примеру хозяин сидит в чате и видит как его опыт из забегов повышается!\r\n\r\nЕсть ограничение на забеги, одновременно можно бегать с одной страницы, смотря кто первый зашёл в забег, кому то придётся подождать пока забег закончится.\r\n\r\nЕсли хозяин заметил что со страницы которую он создал и отдал (началась частая потеря соединения) в любое время можно удалить страницу и создать новую.', 0),
(3, 1, '', 'Без имени', '<span style="color:#FFCC00;">Побег собачек</span><br /><img src="assets://ava100" /><br /> <img src="assets://shop" onclick="clickIT(shop)" /> <img src="assets://bag1" onclick="clickIT(bag)" /> <img src="assets://top" onclick="clickIT(top)" /> <img src="assets://ny1" onclick="clickIT(nytop)" /><br /><span style="#FFCC00;" onclick="clickIT(userInfo,1)">тык на админушку*em3* 123</span>', 0),
(4, 1, '', 'Без имени', '<img src="assets://boar1" /> *em46* Хрю *em46* <img src="assets://boar1" style="scaleX:-1;left:80px;" />', 0);

